import $ from 'jquery';
import axios from 'axios';


class Admin extends Component {


    constructor(props){
      super(props);
      this.state = {date: new Date()}
    }



    render() {
        return (
          <div id="container">
            <div class="row">
              <div class="col-12">
                  Admin
